# yaml-language-server: $schema=.schema.yaml
title: Viral dynamics of acute SARS-CoV-2 infection and applications to diagnostic
  and public health strategies
doi: 10.1056/nejmc2102507
description: >
  This study analyzed densely sampled longitudinal RT-qPCR data from 65 individuals
  infected with SARS-CoV-2, including 7 infected with the B.1.1.7 (Alpha) variant,
  using each person's lowest Ct value as the reference event time point. Inclusion
  criteria required each individual to have at least 5 positive PCR tests (Ct < 40),
  including at least one with Ct < 35. Ct value were collected using the Roche cobas
  SARS-CoV-2 assay and converted to estimated RNA viral concentrations via a standard
  curve and log-linear transformation.
analytes:
  AN_OPS_SARSCoV2:
    description: >
      SARS-CoV-2 RNA gene copy concentration in combined anterior nares and oropharyngeal
      swabs. The concentration was quantified in gene copies per milliliter.
    specimen:
    - anterior_nares_swab
    - oropharyngeal_swab
    biomarker: SARS-CoV-2
    gene_target: N1, N2, RdRp
    limit_of_quantification: unknown
    limit_of_detection: 40
    unit: gc/mL
    reference_event: confirmation date
